import React, { useState } from "react";
import watch1 from "../assets/watch1.png";
import watch2 from "../assets/watch2.png";
import watch3 from "../assets/watch3.png";
import watch4 from "../assets/watch4.png";
import watch5 from "../assets/watch5.png";
import watch6 from "../assets/watch6.png";
import watch7 from "../assets/watch7.png";
import watch8 from "../assets/watch8.png";

const Products = () => {
  const [items, setItems] = useState([
    {
      name: "Watch 1",
      quantity: 1,
      imageUrl: watch1,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
    },
    {
      name: "Watch 2",
      quantity: 1,
      imageUrl: watch2,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
    },
    {
      name: "Watch 3",
      quantity: 1,
      imageUrl: watch3,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
    },
    {
      name: "Watch 4",
      quantity: 1,
      imageUrl: watch4,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
    },
    {
      name: "Watch 5",
      quantity: 1,
      imageUrl: watch5,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
    },
    {
      name: "Watch 6",
      quantity: 1,
      imageUrl: watch6,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
    },
    {
      name: "Watch 7",
      quantity: 1,
      imageUrl: watch7,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
    },
    {
      name: "Watch 8",
      quantity: 1,
      imageUrl: watch8,
      description:
        "GOLDEN HOUR Waterproof Sport Women's Digital Chronograph Silicone Strap Watch",
    },
  ]);

  const [newWatch, setNewWatch] = useState({
    name: "",
    quantity: "",
    description: "",
    imageUrl: "",
  });

  const handleAddWatch = (e) => {
    e.preventDefault();
    if (
      !newWatch.name ||
      !newWatch.quantity ||
      !newWatch.description ||
      !newWatch.imageUrl
    )
      return;

    setItems((prev) => [...prev, newWatch]);
    setNewWatch({ name: "", quantity: "", description: "", imageUrl: "" }); // Reset
  };
  
  const handleEditWatch = (index) => {
    alert(`Edit watch at index ${index} feature not implemented yet.`);
  };
  
  const handleDeleteWatch = (index) => {
    const updatedItems = [...items];
    updatedItems.splice(index, 1);
    setItems(updatedItems);
  };
  
  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold text-center">Product List</h1>

      {/* Add New Watch Form */}
      <form
        onSubmit={handleAddWatch}
        className="max-w-md mx-auto mt-6 p-4 rounded-lg bg-gray-100"
      >
        <input
          className="w-full p-2 rounded border border-gray-300 mt-2"
          placeholder="Watch Name"
          value={newWatch.name}
          onChange={(e) => setNewWatch({ ...newWatch, name: e.target.value })}
        />
        <input
          className="w-full p-2 rounded border border-gray-300 mt-2"
          placeholder="Quantity"
          type="number"
          value={newWatch.quantity}
          onChange={(e) =>
            setNewWatch({ ...newWatch, quantity: e.target.value })
          }
        />
        <input
          className="w-full p-2 rounded border border-gray-300 mt-2"
          placeholder="Description"
          value={newWatch.description}
          onChange={(e) =>
            setNewWatch({ ...newWatch, description: e.target.value })
          }
        />
        <input
          className="w-full p-2 rounded border border-gray-300 mt-2"
          placeholder="Image URL"
          value={newWatch.imageUrl}
          onChange={(e) =>
            setNewWatch({ ...newWatch, imageUrl: e.target.value })
          }
        />
        <button
          className="bg-blue-500 text-white rounded mt-3 px-4 py-2"
          type="submit"
        >
          Add Watch
        </button>
      </form>

      {/* Watch List */}
      <div className="grid grid-cols-2 md:grid-cols-4 gap-4 mt-6">
        {items.map((item, index) => (
          <div
            key={index}
            className="bg-white rounded-lg shadow p-4 flex flex-col items-center"
          >
            <img
              src={item.imageUrl}
              alt={item.name}
              className="w-32 h-32 object-contain rounded"
            />
            <h2 className="text-lg font-bold mt-2">{item.name}</h2>
            <p>Quantity: {item.quantity}</p>
            <p className="text-gray-600 text-sm">{item.description}</p>
            <div className="mt-2 flex space-x-2">
              <button
                onClick={() => handleEditWatch(index)}
                className="bg-yellow-500 text-white rounded px-3 py-1 text-sm"
              >
                Edit
              </button>
              <button
                onClick={() => handleDeleteWatch(index)}
                className="bg-red-500 text-white rounded px-3 py-1 text-sm"
              >
                Delete
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Products;
